style.css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("collegehumor.com") {

/*text&background*/

html, body, tbody, thead, th, tr, td, blockquote, li, ul, h1, h2, h3, h4, h5, h6, p, form, footer, div#content, div#action_bar, #action_bar strong, #tags strong, .two_columns #sidebar_right, #frame .module_title, #frame .section, #footer, #hidden-content, #site-top

{
color: white !important;
background: black !important;
border: black !important;
}

.picks

{
background: black !important;
}

/*links*/

a

{
color: #0040ff !important;
}

/*highlight*/

textarea, pre, #like_wrap

{
background: #333333 !important;
}

}
